import React from 'react';
import navbarLogo from './navbar-logo.png';
import search from './search.png';
import navbarExplore from './explore-icon.png';
import navbarHeart from './navbar-heart.png';
import navbarProfile from './nav-profile.png';
import './App.css';


function App() {
  return (
    <div className="Feed">
      <Navbar />
      <Card/>
    </div>
  )
}

class Navbar extends React.Component {
  render() {
    return (
      <div className="navbar">
        <img id="home" src={navbarLogo} alt="navbar logo" height="150px" width="200px"/>
        <input type="text" placeholder= "Search"></input>
        <img id="explore" src={navbarExplore} alt="Explore icon" height="50px" width="50px"/>
        <img id="notifications" src={navbarHeart} alt="notification icon" height="40px" width="50px"/>
        <img id="profile" src={navbarProfile} alt="profile icon" height="40px" width="50px" />
      </div>

    )
  }
}
// class Card extends React.Component{
//   render() {
//     return (

//     )
// }

export default App;
